import * as React from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import MuiContainer from '@mui/material/Container'; // Renomeando para evitar conflito de nome

export default function Container() {
  return (
    <React.Fragment>
      <CssBaseline />
      <MuiContainer fixed> {/* Usando MuiContainer renomeado */}
        <Box sx={{ bgcolor: '#cfe8fc', height: '100vh' }} />
      </MuiContainer>
    </React.Fragment>
  );
}
